import React, { useState } from "react";
import ListShips from "../../services";

export default () => {
  const [ships, setShips] = useState([]);

  async function list() {
    const response = await ListShips.get().then(result => setShips(result.results[0].name))
  }

  return (
    <>
      <div>{ships}</div>
    </>
  );
};
